bio:
Notre cabinet fournit des services à de nombreuses entreprises dans plusieurs secteurs (automobile, ingénierie, construction, pharmaceutique, Télécom, publicité, etc …);
Nous apportons également une assistance quotidienne sur les questions juridiques et réglementaires pour les grands groupes internationaux ayant investi en Algérie ou souhaitant investir dans ce pays, ainsi que pour les institutions et entreprises publiques et privées algériennes;
Nous sommes en mesure de représenter nos clients auprès les tribunaux, cela nous permet de fournir les services les plus avantageux et complets sur le marché.

bourebi billal
Conseil juridique/avocat chez Cabinet d’avocat
Tâches principales :
– Prendre toute mesure et intervenir dans tout acte de procédure ;
– Exercer tout recours ;
– Donner ou recevoir tout paiement et quittance ;
– Accomplir tout acte comportant l’abandon ou la reconnaissance d’un droit ;
– Diligenter la procédure d’exécution de toute décision de justice.
 Domaine droit privé :
1. S’occuper au départ des contrats entre particuliers ;
2. Être un conseiller en négociations, rédaction de contrats de travail, rédaction d’actes, statuts de sociétés, transaction ;
3. Faire valoir les droits de ses clients et ses conclusions (prétentions du client).
 Domaine droit public :
4. Défendre les citoyens face à l’Etat ;
5. Se mettre en relation directement avec les tribunaux administratifs ;
6. Faire des demandes de lois, décrets, normes et autres qui ont effet sur les citoyens en général. Tous les résultats des
